import './App.css';
import Home from './Components/Home/Home';
import ProductsData from "./Data/Productos"
import Cards from './Components/Cards/Cards';

function App() {
  const tarjeta = ProductsData.map( products => {

    <Cards key={products.id} name={products.name} /> 

  })

return (

 <div className="App">

  <Home /> 
  <Cards />
  <div>{tarjeta}</div>

</div>
)}

export default App;
